import React, { useEffect, useState } from 'react';

export default function Main8() {
    const url = "https://jsonplaceholder.typicode.com/users";
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch(url)
            .then((res) => res.json())
            .then((d) => setData(d));
    }, []);

    return (
        <ol>
            {data.map((item) => (
                <li key={item.id}>{item.stret}</li>
            ))}
        </ol>
    );
}
